import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Avatar = ({ avatarURL, login }) => {
  return (
    <div>
      <img src={avatarURL} alt={`${login}'s avatar`} />
    </div>

  );
};

export default Avatar;
